import React, { useState } from "react";
import './App.css';
import Home from './pages/Home';
import Slider from "./components/SliderComp/Slider";
import { Container, Grid, Typography } from "@material-ui/core";


function App() {

  const [showPage, setShowPage] = useState("all");

  const style = {
    font: {
      color: "white",
      marginLeft: "5%",
      marginRight: "5%"
    },
    poetry: {
      color: "red"
    },
    slider: {
      paddingTop: "10%"
    }
  }
  return (
    <div>
      <Grid container alignItems="center" justifyContent="center" className={"banner"}>
        <Grid item xs="12" md="6">
          <Typography align="center" variant="h3" centered className={"titleFont"}>Andrew</Typography>
          <Typography align="center" variant="h3" centered style={style.font}>Rueter</Typography>
          <Typography align="center" variant="h3" centered style={style.poetry}>Poetry</Typography>
        </Grid>
        <Grid item xs="12" md="6" style={style.slider}>
          <Slider onChange={value => setShowPage(value)}/>
        </Grid>
      </Grid>
      <Home page={showPage}/>

    </div>
  );
}

export default App;
